pragma solidity >=0.7.0 <0.9.0;

contract Father {
    event FatherName(string name);
    function who() public virtual {
        emit FatherName("ChanBak");
    }
}

contract Mother {
    string[] internal courses;
    event MotherName(string name);
    function who() public virtual returns(string[] memory) {
        emit MotherName("EryKim");
        delete courses;
        courses.push("English");
        courses.push("Music");
        return courses;
    }
}

contract Son is Mother {  
    // 다중 상속의 경우 가장 마지막(최신에) 상속한 Mother Cotract 의 who를 상속함
    event sonName(string name);
    function who() public override returns(string[] memory) {
        super.who();
        emit sonName("ColdBak");
        courses.push("Art");
        return courses;
    }
}

